        private void BtnConfirma_Click(object sender, EventArgs e)
        {
            MainWindow ventana = new MainWindow();

            string dist;
            string final = Convert.ToString(CboEdoFinal.SelectedItem);
            string inicio = Convert.ToString(CboEdoInicial.SelectedItem);

            if (ventana.recta.TryGetValue(final, out dist))
            {
                //string[] lines = { inicio, final, dist };
                string[] distancia = { dist };
                string[] comando = { "(LOAD 'cone.txt)", "(LOAD 'recta.txt)", "(LOAD 'AE.txt)", "(AESTRELLA " + inicio + " " + final + " 200)" ,"(OPEN-OUTPUT-FILE 'ciudades.txt' OVERWRITE)", "(WRITE SALIDA 'ciudades.txt)" ,"(CLOSE-OUTPUT-FILE 'ciudades.txt)"};
                // WriteAllLines creates a file, writes a collection of strings to the file,
                // and then closes the file.  You do NOT need to call Flush() or Close().
                //System.IO.File.WriteAllLines(@"C:\Users\Public\Documents\ITAM\Computacion\Inteligencia Artificial\Lisp\pedido.txt", lines);
                System.IO.File.WriteAllLines(@"C:\Users\esteban\Documents\Lisp\recta.txt", distancia);
                System.IO.File.WriteAllLines(@"C:\Users\esteban\Documents\Lisp\corre.LSP", comando);
                //ExecuteCommand(@"C:\Users\esteban\Documents\Lisp\corre.LSP");
                ExecuteCommand("bat");
            }
            else
            {
                MessageBox.Show("No se encontró el destino final");
            }

            this.Close();
        }

        static void ExecuteCommand(String command) {
            var processInfo = new ProcessStartInfo("cmd.exe", "/c" + command);
            processInfo.CreateNoWindow = false;
            processInfo.UseShellExecute = false;
            processInfo.RedirectStandardError = true;
            processInfo.RedirectStandardOutput = true;

            var process = Process.Start(processInfo);

            process.OutputDataReceived += (object sender, DataReceivedEventArgs e) =>
            Console.WriteLine("output>>" + e.Data);
            process.BeginOutputReadLine();

            process.ErrorDataReceived += (object sender, DataReceivedEventArgs e) =>
            Console.WriteLine("error>>" + e.Data);
            process.BeginErrorReadLine();

            process.WaitForExit();

            Console.WriteLine("ExitCode: {0}", process.ExitCode);
            process.Close();
        }

